    const referenceNum = searchQuery.get("reference");
  return (
    <div style={{marginBotto,}}>
        <h1 style={{textAlign : "center"}}>Payment Successful</h1>
        <p style={{textAlign : "center"}}>Reference No. {referenceNum}</p>
    </div>
  )
}
